import React, { Component } from "react";
import "./bar.css";

class bars extends Component {
  constructor(props) {
    super(props);
    this.state = {
      bar: [],
    };
  }
  componentDidMount() {
    fetch("./localhost:5000/lawyersReporter")
      .then((res) => res.json())
      .then((bar = this.setState({ bar })));
  }

  render() {
    return (
      <div>
        <h2>Lawyers</h2>
      </div>
    );
  }
}

export default bars;
